import React, { useEffect } from 'react'
import { useParams } from 'react-router-dom'
import axiosInstance from '../../baseurl'

function ViewProgramTutorials() {
    const {id} = useParams()
    useEffect(()=>{
        axiosInstance.post(`/viewTutorialRequestsByPgmId/${id}`)
        .then((res)=>{console.log(res," Tutorial request list");})
        .catch((err)=>{console.log(err,'error tutorial req list');})

        axiosInstance.post(`/viewtutorialByPgmId/${id}`)
        .then((res)=>{console.log(res);})
        .catch((err)=>{console.log(err);})
        
    },[])
  return (
    <div>ViewProgramTutorials</div>
  )
}

export default ViewProgramTutorials
